import React from "react";
import styled from "styled-components";

const ConnectWalletButton = styled.div`
    height: 42px;
    display: flex;
    display: flex;
    flex-direction: row;
    flex-direction: row;
    ustify-content: center;
    justify-content: center;
    align-items: center;
    align-items: center;
    border-radius: 18px;
    color: #c8c8c8;
    font-size: 13px;
    font-weight: 600;
    letter-spacing: 1.2px;
    text-align: center;
    background-color: #712d45;
    box-shadow: none;
`;

export function ConnectWallet({ connectWallet, networkError, dismiss }) {
    return (
        <ConnectWalletButton>ETH</ConnectWalletButton>
    );
}
